commits.content:
{
    font-family: sans-serif;
}

h1, h2, h3, h4, h5 {
    font-family: serif;
    text-align: center;
}

a {
    text-decoration: none;
    color: #4242ea;
}

ul {
    list-style: none;
}

footer span {
    font-weight: 700;
}

.weather p {
    font-size: 40px;
    text-align: center;
}

.above-the-fold article {
    display: inline-block;
}

.weather {
    width: 300px;
    border: 2px solid gray;
    margin: auto;
    width: 300px;
}

.breaking-news {
    padding-top: 0px;
    padding-bottom: 0px;
    padding-left: 30px;
    padding-right: 30px;
}

.breaking-news img {
    width: 200px;
    display: block;
    margin-left: auto;
    margin-right: auto;
}

.click-bait article {
    display: inline-block;
    width: 250px;
    padding: 16px;
    margin: 16px;
    box-sizing: border-box;
}

.below-the-fold article {
    display: inline-block;
}

.below-the-fold img {
    display: inline-block;
    padding: 16px;
    margin: 16px;
    width: 200px;
}

.below-the-fold div {
    width: 500px;
}
